int stackisFull(Stack* stackPtr)
{
  UNITY_LINE_TYPE cmock_line = TEST_LINE_NUM;
  CMOCK_stackisFull_CALL_INSTANCE* cmock_call_instance = (CMOCK_stackisFull_CALL_INSTANCE*)CMock_Guts_GetAddressFor(Mock.stackisFull_CallInstance);
  Mock.stackisFull_CallInstance = CMock_Guts_MemNext(Mock.stackisFull_CallInstance);
  if (Mock.stackisFull_IgnoreBool)
  {
    if (cmock_call_instance == NULL)
      return Mock.stackisFull_FinalReturn;
    Mock.stackisFull_FinalReturn = cmock_call_instance->ReturnVal;
    return cmock_call_instance->ReturnVal;
  }
  if (Mock.stackisFull_CallbackFunctionPointer != NULL)
  {
    return Mock.stackisFull_CallbackFunctionPointer(stackPtr, Mock.stackisFull_CallbackCalls++);
  }
  UNITY_TEST_ASSERT_NOT_NULL(cmock_call_instance, cmock_line, "Function 'stackisFull' called more times than expected.");
  cmock_line = cmock_call_instance->LineNumber;
  if (cmock_call_instance->CallOrder > ++GlobalVerifyOrder)
    UNITY_TEST_FAIL(cmock_line, "Function 'stackisFull' called earlier than expected.");
  if (cmock_call_instance->CallOrder < GlobalVerifyOrder)
    UNITY_TEST_FAIL(cmock_line, "Function 'stackisFull' called later than expected.");
  UNITY_TEST_ASSERT_EQUAL_MEMORY((void*)(cmock_call_instance->Expected_stackPtr), (void*)(stackPtr), sizeof(Stack), cmock_line, "Function 'stackisFull' called with unexpected value for argument 'stackPtr'.");
  if (cmock_call_instance->ExceptionToThrow != CEXCEPTION_NONE)
  {
    Throw(cmock_call_instance->ExceptionToThrow);
  }
  return cmock_call_instance->ReturnVal;
}

